import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <form>
        <label htmlFor="input-email">
          Digite seu email:
          <input id="input-email" name="input-email" type="email" />
        </label>

      </form>
    );
  }
}
export default Login;
